style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("eve-survival.org") {
    body,#content,#footer,#smallprint,#commentheader {
        color: #789;
        border: 0px solid #CCC;
        background-color: #111;
    }
    #comments {
        border-bottom: 0px solid #CCC;
    }
    a {
        color: #9ab;
    }
    h1, h2, h3, h4, h5 {
        color: #cde;
    }
    a#homepage_link {
        color: #ccc;
    }
    .lastedit {
        border: 0px solid #ccc;
        color: #456;
        font-size: 10px;
    }
    hr {
        border-color: #123;
    }
}
